import React, { Component } from 'react';
import './About.css';

class About extends Component {
    render() {
        return (
            <div id="about">
                <h2 className='section-title'>About</h2>
                <p className='about-text'>
                    Hey, My name is D’Andre. I’m a self taught, aspiring Front End Web Developer based out of New York. I choose this area because it allows me to combine my creative side with my love for coding. Currently, I’m working in the IT field as a Technician but I’ve always had am interest in the Development field. I have 4 years of programming in various different languages but currently React.js is my main focus.
                </p>
            </div>
        )
    }
}

export default About;
